import React from "react";
import "./style.css";

const Contacts = () => {

    return(
        <div className="contacts">
            <div className="contacts-full-size">
                <div className="container">
                    <div className="contacts__wrapper">
                        <h1>КОНТАКТЫ</h1>
                        <div className="contacts__adress-header">Наш адрес:</div>
                        <h2>​Краснолесье дом 14 корпус 5, Академический район, Екатеринбург, 620110</h2>
                        <div className="contacts__work-time"></div>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Contacts;
